Файлаш сервера чуйоахаргйолаш пайда эца укх кепах.
ХьалхагӀа чуяьха хиннача файлашка [[Special:FileList|укхаза хьажа йиш я]]. Файл чуяккхар а, чуяьккха хиннар кердайоаккхаш юха чуяккхар а, дӀаязду [[Special:Log/upload|чуяьхарий тептара чу]]; дӀаяьха хиннача файлех лаьца деша йиш я [[Special:Log/delete|дӀадаьхарий тептара чу]].

Файл статьянна чуйоаккхаргйолаш тӀатовжам укх тайпарча формате хилийта:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> файл ше йолчча тайпара (ший бӀарччача боарамца) юкъейоаккхаргйолаш;
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|Caption]]</nowiki></code></strong> 200 пикселах кIезигъяь йолаш йола файл текста аьрдехьа юкъейоаккхаргйолаш (файлах лаьца белгалдаь дола йоазув лохе хьа а гойташ);
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> файла тIахьожавеш бола тIатовжам юкъебоаккхаргболаш (цун чудар оагIона тIа хьа а ца гойташ).
